println(s"""%angular
    <style>

    .bar rect {
      fill: steelblue;
    }

    .bar text {
      font: 10px sans-serif;
    }

    </style>
    <h4>Distribution of bigrams</h4>
    <svg id="countHistogramSVG" width="500" height="300" font-family="sans-serif" font-size="10" text-anchor="middle"></svg>
    <script type="text/javascript" src="https://d3js.org/d3.v4.min.js"></script>
    <script type="text/javascript">
        function drawChart() {
            var data = ${counts};

            var formatCount = d3.format(",.0f");

            var svg = d3.select("#countHistogramSVG"),
                margin = {top: 30, right: 30, bottom: 30, left: 30},
                width = +svg.attr("width") - margin.left - margin.right,
                height = +svg.attr("height") - margin.top - margin.bottom,
                g = svg.append("g").attr("transform", "translate(" + margin.left + "," + margin.top + ")");

            var x = d3.scaleLinear()
                .domain([0, ${maxCount}])
                .rangeRound([0, width]);

            var bins = d3.histogram()
                .domain(x.domain())
                .thresholds(x.ticks(20))
                (data);

            var y = d3.scaleLinear()
                .domain([0, d3.max(bins, function(d) { return d.length; })])
                .range([height, 0]);

            var bar = g.selectAll(".bar")
              .data(bins)
              .enter().append("g")
                .attr("class", "bar")
                .attr("transform", function(d) { return "translate(" + x(d.x0) + "," + y(d.length) + ")"; });

            bar.append("rect")
                .attr("x", 1)
                .attr("width", x(bins[0].x1) - x(bins[0].x0) - 1)
                .attr("height", function(d) { return height - y(d.length); });

            bar.append("text")
                .attr("dy", ".75em")
                .attr("y", -16)
                .attr("x", (x(bins[0].x1) - x(bins[0].x0)) / 2)
                .attr("text-anchor", "middle")
                .text(function(d) { return formatCount(d.length); });

            g.append("g")
                .attr("class", "axis axis--x")
                .attr("transform", "translate(0," + height + ")")
                .call(d3.axisBottom(x));
        }
        if (d3 !== undefined) {
            drawChart();
        } else {
            var sc = document.createElement('script');
            sc.type = 'text/javascript';
            sc.src = 'https://d3js.org/d3.v4.min.js';
            sc.onload = drawChart;
            sc.onerror = function(err) { alert(err); }
            document.getElementsByTagName('head')[0].appendChild(sc);
        }

    </script>
    """)

